import React from "react";
import logo from "./logo.png";
import emailjs from "emailjs-com";
import { useRef } from "react";

export default function App() {
  const form = useRef();

  const sendEmail = (e) => {
    e.preventDefault();

    emailjs
      .sendForm(
        "your_service_id",
        "your_template_id",
        form.current,
        "your_user_id"
      )
      .then(
        (result) => {
          console.log(result.text);
          alert("Message sent successfully!");
        },
        (error) => {
          console.log(error.text);
          alert("An error occurred, please try again.");
        }
      );
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-green-900 via-emerald-800 to-teal-900 text-white font-sans">
      {/* Header */}
      <header className="sticky top-0 z-50 backdrop-blur bg-emerald-900/80 shadow-md">
        <div className="max-w-7xl mx-auto px-4 py-4 flex items-center justify-between">
          <div className="text-left">
            <h1 className="text-2xl font-bold">SafeCircle</h1>
            <p className="text-sm text-emerald-200">Your private emotional support space</p>
          </div>
          <img src={logo} alt="Logo" className="w-14 h-14 rounded-full shadow-lg" />
        </div>
      </header>

      {/* Hero Section */}
      <section className="py-20 px-4 text-center bg-gradient-to-r from-emerald-800 to-teal-800 shadow-inner">
        <div className="max-w-4xl mx-auto flex flex-col md:flex-row items-center justify-between">
          <div className="text-left mb-10 md:mb-0">
            <h2 className="text-4xl md:text-5xl font-bold mb-4">Welcome to SafeCircle</h2>
            <p className="text-lg text-emerald-100 max-w-md">
              A safe, confidential space to talk, heal, and feel heard. Book a private session with us today.
            </p>
          </div>
          <img
            src={logo}
            alt="SafeCircle Logo"
            className="w-36 h-36 animate-pulse rounded-full border-4 border-emerald-500 shadow-xl"
          />
        </div>
      </section>

      {/* Booking Section */}
      <section className="py-16 px-4 max-w-3xl mx-auto">
        <h2 className="text-3xl font-semibold text-center mb-8">Book a Session</h2>
        <form ref={form} onSubmit={sendEmail} className="space-y-6 bg-emerald-950 bg-opacity-40 p-8 rounded-2xl shadow-xl">
          <input type="text" name="name" placeholder="Your Name" required className="w-full p-3 rounded bg-emerald-100 text-black" />
          <select name="occupation" required className="w-full p-3 rounded bg-emerald-100 text-black">
            <option value="">Select Occupation</option>
            <option value="Student">Student</option>
            <option value="Working Professional">Working Professional</option>
            <option value="Other">Other</option>
          </select>
          <input type="date" name="preferred_date" required className="w-full p-3 rounded bg-emerald-100 text-black" />
          <input type="text" name="whatsapp" placeholder="WhatsApp Number" required className="w-full p-3 rounded bg-emerald-100 text-black" />
          <input type="email" name="email" placeholder="Email ID" required className="w-full p-3 rounded bg-emerald-100 text-black" />
          <textarea name="problem" placeholder="Describe your issue..." required rows="4" className="w-full p-3 rounded bg-emerald-100 text-black"></textarea>
          <input type="file" name="image" className="w-full p-3 rounded bg-emerald-100 text-black" />
          <p className="text-sm text-emerald-200 italic">*Upload payment confirmation screenshot</p>
          <button type="submit" className="w-full bg-emerald-700 hover:bg-emerald-600 p-3 rounded text-white font-semibold">Submit</button>
          <p className="text-xs text-center text-emerald-300">Our team will contact you after payment confirmation.</p>
        </form>
      </section>

      {/* Footer */}
      <footer className="bg-emerald-950 bg-opacity-60 text-center py-6 mt-10">
        <p className="text-emerald-300">© 2025 SafeCircle. All rights reserved.</p>
      </footer>
    </div>
  );
}
